        <footer className="copyright">
       
         {userInfo && !userInfo.isAdmin && <ChatBox  userInfo={userInfo} />}
         <div>
              Copyright Â© 2021 .All rights reserved by <a className="The-Cakesmith">The Cakesmith</a>.
          </div>{' '}
     </footer>
    )

    }
                
    export default Footer;
